webpackJsonp([0xbc5fdc760a18],{1078:function(t,n){t.exports={data:{wordpressPost:{title:"Swimsuit Models Renee and Elisha Herbert Talk Faux Tans And Much More",content:'<p>Social media stars, models, travellers, twins and impressive young women Renee and Elisha Herbert have landed a gig as ambassadors for the <a href="https://www.letan.com.au/tanning/uber-dark">sun care brand Le Tan</a>. It shouldn&#8217;t come as a surprise really. The sisters are beach babes from way back and know more than most about what makes for a perfect faux tan.</p>\n<p>A quick glance at this sweet snap of the girls on a boat in Hawaii below will confirm that.</p>\n<figure id="attachment_3493" style="width: 472px" class="wp-caption alignnone"><img class="size-full wp-image-3493" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04233651/JPG-Reneeherbert-insta.jpg" alt="" width="472" height="594" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04233651/JPG-Reneeherbert-insta.jpg 472w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04233651/JPG-Reneeherbert-insta-238x300.jpg 238w" sizes="(max-width: 472px) 100vw, 472px" /><figcaption class="wp-caption-text">Image: Instagram/@reneeherbert</figcaption></figure>\n<p>&nbsp;</p>\n<p>Yes &#8211; they&#8217;re beautiful. They&#8217;re also clever and interesting too. And so when we had a chance for a quick chat with both we jumped at the chance. Take it away Renee and Elisha &#8230;</p>\n<p><strong>It&#8217;s Friday night you get ready by &#8230;</strong></p>\n<p><strong>Renee:</strong> Putting on music, dancing a little &amp; going through multiple different outfit choices.</p>\n<p><strong>Elisha:</strong> Rocking out to some of your favourite tunes playing dress ups with your various outfit choices.</p>\n<p><strong>Your hair is going to be &#8230;</strong></p>\n<p><strong>R:</strong> All natural baby! A little wavy.</p>\n<p><strong>E:</strong> Out and straightened (depending if it&#8217;s a bad hair day or not).</p>\n<p><strong>Makeup look will be &#8230;</strong></p>\n<p><strong>R:</strong> Super French vibes! Red lippy &amp; winged eyeliner always.</p>\n<p><strong>E:</strong> Lots of glowy highlighter and warm tones for the eyes</p>\n<p><strong>You&#8217;re going to wear &#8230;</strong></p>\n<p><strong>R:</strong> Ripped jeans, a super cute cropped tee, boot heels and lots of rings.</p>\n<p><strong>E:</strong> Something that&#8217;s easy to dance in,  preferably a cool top with some groovy pants and boot heels.</p>\n<figure id="attachment_3490" style="width: 619px" class="wp-caption alignnone"><img class="size-full wp-image-3490" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04231907/JPG-Renee.jpg" alt="" width="619" height="636" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04231907/JPG-Renee.jpg 619w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04231907/JPG-Renee-292x300.jpg 292w" sizes="(max-width: 619px) 100vw, 619px" /><figcaption class="wp-caption-text">Well hello Renee. new star of Le Tan.</figcaption></figure>\n<p><strong>And you&#8217;ll definitely apply a little &#8230;</strong></p>\n<p><strong>R:</strong><a href="https://www.letan.com.au/product/5614/uber-dark-marula-oil-200ml"> Le Tan Uber Dark – Marula Oil</a>, which gives me the darkest possible tan, with added hydration which I just love.</p>\n<p><strong>E:</strong> Bit of lippy</p>\n<p><strong>When you&#8217;re not feeling like you look as hot as you want to you also reach for &#8230;</strong></p>\n<p><strong>R:</strong> Highlighter! It makes me shine!</p>\n<p><strong>E:</strong> The false lashes and some eyeliner</p>\n<p><strong>Which makes you feel &#8230;</strong></p>\n<p><strong>R:</strong> Shiny &amp; beautiful.</p>\n<p><strong>E:</strong> Like a woman</p>\n<p><strong>Your mama always taught you that &#8230;</strong></p>\n<p><strong>R:</strong> Don’t always try to fit in, be who you want to be!</p>\n<p><strong>E:</strong> You gotta be your most honest self and live life with no apologies.</p>\n<figure id="attachment_3498" style="width: 475px" class="wp-caption alignnone"><img class="size-full wp-image-3498" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04235008/JPG-Elisha-H.jpg" alt="" width="475" height="588" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04235008/JPG-Elisha-H.jpg 475w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04235008/JPG-Elisha-H-242x300.jpg 242w" sizes="(max-width: 475px) 100vw, 475px" /><figcaption class="wp-caption-text">Image: Instagram/@Elisha_h</figcaption></figure>\n<p><strong>The one thing you&#8217;ll never ever leave the house without is &#8230;</strong></p>\n<p><strong>R:</strong> Lip gloss or red lippy.</p>\n<p><strong>E:</strong> My phone! It&#8217;s honestly with me nearly every minute of the day &#8211; a bad habit</p>\n<p><strong>You feel naked if you don&#8217;t wear &#8230;</strong></p>\n<p><strong>R:</strong> Jewellery. It always completes my outfit.</p>\n<p><strong>E:</strong> A bit of Jewellery! I feel bare without it.</p>\n<p><strong>You bump into your high school crush. You respond by &#8230;</strong></p>\n<p><strong>R:</strong> Running away.</p>\n<p><strong>E:</strong> Having a casual conversation</p>\n<p><strong>One day you&#8217;re going to &#8230;</strong></p>\n<p><strong>R:</strong> Have a lot of sausage dogs running around.</p>\n<p><strong>E:</strong> Live somewhere else in the world for a year or two and learn different languages</p>\n<figure id="attachment_3489" style="width: 608px" class="wp-caption alignnone"><img class="size-full wp-image-3489" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04231625/JPG-ELISHA-1.jpg" alt="" width="608" height="590" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04231625/JPG-ELISHA-1.jpg 608w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04231625/JPG-ELISHA-1-300x291.jpg 300w" sizes="(max-width: 608px) 100vw, 608px" /><figcaption class="wp-caption-text">And over to you Elisha.</figcaption></figure>\n<p><strong>And when you do it will feel truly &#8230;</strong></p>\n<p><strong>R:</strong> Happy.</p>\n<p><strong>E:</strong> Freeing and euphoric</p>\n<p><strong>You&#8217;d be pretty damn happy if you could own &#8230;</strong></p>\n<p><strong>R:</strong> A piglet.</p>\n<p><strong>E:</strong> Lots of miniature and adorable  animals</p>\n<p><strong>Your ultimate wish is &#8230;</strong></p>\n<p><strong>R:</strong> To explore the world.</p>\n<p><strong>E:</strong> To be an actress or help to stop global warming. Or both.</p>\n',better_featured_image:{source_url:"http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/11/04233713/JPG-renee-italy.jpg"},categories:[{slug:"beauty-talk",name:"Beauty Talk"}]},site:{siteMetadata:{title:"The Beauty Insider"}}},pathContext:{id:"a61c6a19-c3b2-5e34-8964-183d87dd070e"}}}});
